import LeftPane from "../LeftPane/LeftPane";
import RightPane from "../RightPane/Rightpane";
import "./Dashboard.css";
import treeImage from"../../img/tree.jpeg";
import suitcaseImage from"../../img/suitcase.jpeg";
import grassImage from "../../img/grass.jpeg"


const Dashboard = () => {
    let navigationListItems =
        [
            {
                name: "Home",
                message: 0,
            },
            {
                name: "Facturen",
                message: 0,
            },
            {
                name: "Bestellingen",
                message: 1,
            },
            {
                name: "Retour",
                message: 1,
            },
            {
                name: "Contact",
                message: 2,
            },
        ]

    let productCards =
        [
            {
                name: "Placeholder",

            },
            {
                name: "Tree",
                img: {treeImage}
            },
            {
                name: "Suitcase",
                img: suitcaseImage
            }

        ]
    let buttonText
    return (<article className="dashboard">
        <LeftPane navigationListItems={navigationListItems} buttonText="Go Premium" />
        <RightPane productCards={productCards} headerText={"Mijn Producten"} buttonSymbol="+" butttonText={"Voeg product toe"} />
    </article>
    );
}
export default Dashboard
